import styled from 'styled-components';
const Border = styled.div`
overflow: hidden;
background: transparent;
margin: 15px 0px;
position: absolute;
left: 62%;
width: 38%;
height: 22%;
top: 32.5%;
border-bottom: solid black 2px;
`
const GraphHeader = styled.div`
font-size: 15px;
text-align: center;
overflow: hidden;
background: transparent;
position: absolute;
width: 58%;
height: 100%;
border-right: solid black 2px;
padding-top: 1%;
`
const Graph = styled.div`
overflow: hidden;
background: transparent;
position: absolute;
top: 15%;
height: 100%;
width: 58%;
border: solid black 2px;
`

const Map = styled.div`
overflow: hidden;
background: transparent;
display: flex;
position: absolute;
left: 60%;
top: 0%;
height: 100%;
border: solid blue 2px;
`
export const Select = styled.select`
height: 15%;
width: 40%;

`
const Options = () => {
    return (
        <Border>
        <GraphHeader>
            Graph Options
        </GraphHeader>
        <Graph>
        <Select>
            <option >Weeks</option> <option >Months</option> <option >Years</option>

        </Select>

        </Graph>




        </Border>
    )
}

export default Options
